#include <iostream>
#include <fstream>

using namespace std;

const int TABLE_SIZE = 800;
const double AREA1_SIZE = 0.6 * TABLE_SIZE;
const double AREA2_SIZE = 0.1 * TABLE_SIZE;

struct Registro {
    int Codigo;
    char Titulo[100];
    char Autor[100];
    int Anio;
};

// Función hash 1
int hash1(int key) {
    return key % TABLE_SIZE;
}

// Función hash 2
int hash2(int key) {
    return (key + 1) % TABLE_SIZE; // Usamos una función hash simple aquí
}

// Insertar un registro en la tabla hash
void insertRegistro(Registro tabla[], Registro registro) {
    int key = registro.Codigo;
    int hashValue1 = hash1(key);

    // Si el lugar está vacío o borrado, insertamos el registro directamente
    if (tabla[hashValue1].Codigo == -1) {
        tabla[hashValue1] = registro;
        return;
    }

    // Si hay colisión en el área 1, probamos con el área 2
    int hashValue2 = hash2(key);
    for (int i = 0; i < TABLE_SIZE; ++i) {
        int index = (hashValue1 + i * hashValue2) % TABLE_SIZE;
        if (tabla[index].Codigo == -1) {
            tabla[index] = registro;
            return;
        }
    }

    // Si no se pudo insertar el registro, la tabla está llena
    cout << "No se pudo insertar el registro. La tabla esta llena." << endl;
}

// Mostrar la tabla hash en pantalla
void displayTabla(Registro tabla[]) {
    for (int i = 0; i < TABLE_SIZE; ++i) {
        if (tabla[i].Codigo != -1) {
            cout << "Posicion " << i << ": "
                 << "Codigo: " << tabla[i].Codigo
                 << ", Titulo: " << tabla[i].Titulo
                 << ", Autor: " << tabla[i].Autor
                 << ", Anio: " << tabla[i].Anio << endl;
        }
    }
}

// Guardar la tabla hash en un archivo "tabla_hash.dat"
void saveTablaToFile(Registro tabla[]) {
    ofstream file("tabla_hash.dat", ios::binary);
    if (!file) {
        cout << "Error al abrir el archivo." << endl;
        return;
    }

    file.write(reinterpret_cast<char*>(tabla), sizeof(Registro) * TABLE_SIZE);
    file.close();

    cout << "Tabla guardada en tabla_hash.dat" << endl;
}

// Cargar la tabla hash desde el archivo "tabla_hash.dat"
void loadTablaFromFile(Registro tabla[]) {
    ifstream file("tabla_hash.dat", ios::binary);
    if (!file) {
        cout << "Error al abrir el archivo." << endl;
        return;
    }

    file.read(reinterpret_cast<char*>(tabla), sizeof(Registro) * TABLE_SIZE);
    file.close();

    cout << "Tabla cargada desde tabla_hash.dat" << endl;
}

// Función para ingresar un registro por teclado
Registro ingresarRegistroPorTeclado() {
    Registro registro;

    cout << "Ingrese el codigo del libro: ";
    cin >> registro.Codigo;
    cin.ignore(); // Ignoramos el salto de línea en el buffer

    cout << "Ingrese el titulo del libro: ";
    cin.getline(registro.Titulo, 100);

    cout << "Ingrese el autor del libro: ";
    cin.getline(registro.Autor, 100);

    cout << "Ingrese el año de publicacion: ";
    cin >> registro.Anio;

    return registro;
}

// Función para mostrar el menú y obtener la opción del usuario
int mostrarMenu() {
    int opcion;
    cout << "\n-- MENU --" << endl;
    cout << "1. Agregar registro" << endl;
    cout << "2. Mostrar tabla" << endl;
    cout << "3. Guardar tabla en archivo" << endl;
    cout << "4. Cargar tabla desde archivo" << endl;
    cout << "5. Mostrar ocupaciones" << endl;
    cout << "6. Mostrar tabla de colison 1" << endl;
    cout << "7. Mostrar tabla de colison 2" << endl;
    cout << "8. Salir" << endl;
    cout << "Ingrese una opcion: ";
    cin >> opcion;
    return opcion;
}

void calcularPorcentajeOcupacion(Registro tabla[], double area1_size, double area2_size);
void mostrarTablaColision1(Registro tabla[], double area1_size, double area2_size);
void mostrarTablaColision2(Registro tabla[], double area1_size, double area2_size);

int main() {
    Registro tabla[TABLE_SIZE];

    // Inicializar la tabla con registros vacíos
    for (int i = 0; i < TABLE_SIZE; ++i) {
        tabla[i].Codigo = -1;
    }

    // Cargamos la tabla desde el archivo (si existe)
    loadTablaFromFile(tabla);

    // Ejemplo de inserción de otro registro que colisiona
    //Registro registro3 = {5723, "Libro 3", "Autor 3", 2021};
    //insertRegistro(tabla, registro3);

    int opcion;
    do {
        opcion = mostrarMenu();
        switch (opcion) {
            case 1: {
                Registro nuevoRegistro = ingresarRegistroPorTeclado();
                insertRegistro(tabla, nuevoRegistro);
                break;
            }
            case 2:
                displayTabla(tabla);
                break;
            case 3:
                saveTablaToFile(tabla);
                break;
            case 4:
                loadTablaFromFile(tabla);
                break;
            case 5:
                calcularPorcentajeOcupacion(tabla, AREA1_SIZE, AREA2_SIZE);
                break;
            case 6:
                mostrarTablaColision1(tabla, AREA1_SIZE, AREA2_SIZE);
                break;
            case 7:
                mostrarTablaColision2(tabla, AREA1_SIZE, AREA2_SIZE);
                break;
            case 8:
                cout << "Saliendo del programa..." << endl;
                break;
            default:
                cout << "Opción inválida. Intente de nuevo." << endl;
                break;
        }
    } while (opcion != 8);

    return 0;
}

// Método para calcular el porcentaje de ocupación del espacio de datos, área 1 de colisiones y área 2 de colisiones.
void calcularPorcentajeOcupacion(Registro tabla[], double area1_size, double area2_size) {
    int ocupacionDatos = 0;
    int ocupacionColision1 = 0;
    int ocupacionColision2 = 0;

    for (int i = 0; i < TABLE_SIZE; ++i) {
        if (tabla[i].Codigo != -1) {
            // Si el registro no está vacío, se considera ocupado.
            if (i < area1_size) {
                ocupacionDatos++;
            } else if (i < area1_size + area2_size) {
                ocupacionColision1++;
            } else {
                ocupacionColision2++;
            }
        }
    }

    double porcentajeOcupacionDatos = (static_cast<double>(ocupacionDatos) / area1_size) * 100;
    double porcentajeOcupacionColision1 = (static_cast<double>(ocupacionColision1) / area2_size) * 100;
    double porcentajeOcupacionColision2 = (static_cast<double>(ocupacionColision2) / (TABLE_SIZE - area1_size - area2_size)) * 100;

    cout << "Porcentaje de ocupacion del espacio de datos: " << porcentajeOcupacionDatos << "%" << endl;
    cout << "Porcentaje de ocupacion del área 1 de colisiones: " << porcentajeOcupacionColision1 << "%" << endl;
    cout << "Porcentaje de ocupacion del área 2 de colisiones: " << porcentajeOcupacionColision2 << "%" << endl;
    main();
}

